def get_positive_accuracy(pred, truth):
   right_positive = 0
   total_positive = 0
   for i in range(0, len(truth)):
      pathology = int(truth[i][0])
      if(pathology == 1):
         total_positive += 1
         if(pred[i] == 1):
            right_positive += 1
      
     
   return float(right_positive)/float(total_positive)

def get_negative_accuracy(pred, truth):
   right_negative = 0
   total_negative = 0
   for i in range(0, len(truth)):
      pathology = int(truth[i][0])
      if(pathology == 0):
         total_negative += 1
         if(pred[i] == 0):
            right_negative += 1
   return float(right_negative)/float(total_negative)
   
